	"source": "pragma solidity ^0.8.0;\n\nimport \"@openzeppelin/contracts/token/ERC721/ERC721.sol\";\nimport \"@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol\";\nimport \"@openzeppelin/contracts/utils/Counters.sol\";\n\ncontract GlitterNFT is ERC721, ERC721URIStorage {\n    using Counters for Counters.Counter;\n    Counters.Counter private _tokenIds;\n\n    constructor() ERC721(\"GlitterNFT\", \"GNFT\") public {}\n    \n    function mintGlitter() public returns (uint256) {\n\n        _tokenIds.increment(); \n        uint256 newItemId = _tokenIds.current();\n        _mint(msg.sender, newItemId);\n        _setTokenURI(newItemId, \"glitter.json\");\n\n        return newItemId;\n    }\n    \n    function _baseURI() internal pure override returns (string memory) {\n        return \"https://raw.githubusercontent.com/2pai/nft-erc721/main/item/\";\n    }\n    \n    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {\n        super._burn(tokenId);\n    }\n    \n    function tokenURI(uint256 tokenId)\n        public\n        view\n        override(ERC721, ERC721URIStorage)\n        returns (string memory)\n    {\n        return super.tokenURI(tokenId);\n    }\n\n}\n",
